$(document).ready(function(){
   

    $("#business-search").keyup(function(){

        returned_list = ""
        let entered_letters = $(this).val()
        // obj.name.includes(entered) || obj.category.includes(entered
        filtered_list = directory.filter(obj => (obj.name.includes(entered_letters)))
        for (single_item of filtered_list){
            returned_list += '<li class="selection" category="'+ single_item.business +'"  line1="'+ single_item.address1 +'" line2="'+ single_item.address2 +'" line3="'+ single_item.address3 +'" phone="'+ single_item.phone +'">' + single_item.name + '</li>'
        }
        
        $("#found_items").html(returned_list)
        $("#found_items").show()
        $(".business-search-result").text("")
       })
    
       $(document).on("click", ".selection", function(){
        category = $(this).attr("category")
        business_name =  $(this).text()
        address1 =  $(this).attr("line1")
        address2 =  $(this).attr("line2")
        address3 =  $(this).attr("line3")
        phone =   $(this).attr("phone")
    
        $("#name_of_business").text(business_name)
        $("#address_line1").text(address1)
        $("#address_line2").text(address2)
        $("#address_line3").text(address3)
        $("#telephone_number").text(phone)
        $("#nature_of_business").text("School Location: " + category)

        $("#found_items").hide()
        $("#business-search").val("")
    
       })

  
});